import React from "react";
import "./styles.css";

import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

import Slider from "react-slick";





export const SlideViewProjects= ()=> {
  const renderSlides = () =>
  [1, 2, 3, 4, 5, 6, 7, 8].map(num => (
    <div>
<div className="slick-slide" >
              <h2 className="slick-slide-title">Title{num}</h2>

              <img className="slick-slide-image" src='./goal.jpg' />
              <label className="slick-slide-label">label</label>
            </div>



      <h3>Slide {num}</h3>
    </div>
  ));



  var settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    nextArrow: (
      <div>
        <div className="next-slick-arrow"> ⫸ </div>
      </div>
    ),
    prevArrow: (
      <div>
        <div className="prev-slick-arrow"> ⫷ </div>
      </div>
    )

  };

return (
  <div >
    <Slider {...settings}
      className='slider'

    >
      {renderSlides()}
    </Slider>
  </div>
);
  }
